import React from "react";
import ProjectItem from "../../Components/ProjectList/ProjectItem";
import project1 from "../../Components/image/library.jpeg"
import project2 from "../../Components/image/employee.jpeg"
import project3 from "../../Components/image/movie.jpeg"
import project4 from "../../Components/image/COVID-19.jpeg"
import project5 from "../../Components/image/game.jpeg"
import project6 from "../../Components/image/data.jpeg"





import "./Projects.css";




function Projects() {
  return (
    <div className="projects">
        <div className="projectList">
            <ProjectItem name="Library Management Web" image={project1} overview="Developed library web pages with Django and implement librarian and user management functions."/> 
            <ProjectItem name="Employee Management Web" image={project2} overview="Build RESTful API with Spring Boot and MySQL to handle HTTP requests and responses, created CRUD operations to fetch data with queries."/> 
            <ProjectItem name="Movie Application" image={project3} overview="Developed movie website allows users to view the movie information and search the movie."/> 
            <ProjectItem name="Hospital On-Wheels System" image={project4} overview="Developed library web pages with Django and implement librarian and user management functions."/> 
            <ProjectItem name="Number Guessing Game" image={project5}/> 
            <ProjectItem name="Data Visualization Analysis" image={project6}/> 

        </div>

    </div>
  );
}

export default Projects;
